window.bookSummaryJSON = "<p>A string of smashing victories by the forces of the sinister aliens known as the Yuuzhan Vong has stretched the New Republic's resources and morale to the breaking point. Leia Organa Solo, estranged from her husband, Han, oversees the evacuation of refugees on planets in the path of the merciless invaders. Luke Skywalker struggles to hold the fractious Jedi Knights together, even while one of them undertakes a bold but reckless undercover mission.</p> <p>Manipulating their alliance with the amoral Hutts, the Yuuzhan Vong leave a cunning trail of vital information where New Republic agents are sure to find it - information the desperate defenders cannot afford to ignore: the location of the aliens' next target.</p> <p>Then Han Solo stumbles into the dark heart of a raging battle, thus beginning a furious race against time that will require every skill and trick in his arsenal to win.</p>"; 
